        4,NULL,'2023-09-01',21,6,21,'2023-08-22 07:47:47.205371','2023-08-22 07:48:14.294091',
        1,NULL,6,'1주차:<br>- 첫 주는 풍경화 작업에 앞서 필요한 준비물을 모두 준비합니다. 종이, 붓, 그림용 양초 등을 구매하고 작업공간을 깨끗하게 정리합니다.<br>- 풍경화 작업을 하기 전에 일주일 동안 매일 조깅이나 요가 등을 통해 몸과 마음을 풀어주는 시간을 가집니다.<br>- 자연에서 영감을 받아 풍경화를 그리는 것이므로, 하루에 한 번 정원이나 공원에 가서 자연을 감상하며 스케치를 합니다.<br><br>2주차:<br>- 두 번째 주차는 실제 풍경화 작업에 들어갑니다. 흔들림 없고 집중할 수 있는 시간을 갖기 위해 작업을 할 수 있는 조용하고 평화로운 장소를 찾습니다.<br>- 매일 최소 1시간 이상을 작업에 투자하며, 첫 주에 스케치한 내용을 바탕으로 작품을 완성해 나갑니다.<br>- 작업 도중에 음악을 듣거나 차를 마시거나 편안한 분위기를 조성하여 스트레스를 줄이고 집중력을 높입니다.<br><br>3주차:<br>- 세 번째 주차는 작업의 마무리와 보완을 위한 시간을 가집니다. 완성된 작품을 한번씩 살펴보며 미흡한 부분을 발견하고 수정합니다.<br>- 다른 작가들의 풍경화 작품들을 감상하며 자신만의 독특한 스타일을 발전시킬 아이디어를 찾습니다.<br>- 작품을 완성된 상태로 냉장고나 벽에 걸어두고 자주 보면서 만족감을 느끼고 더욱 향상시킬 부분을 계속 찾아냅니다.<br><br>이와 같은 계획을 세우면 3주 동안 풍경화를 완성하기 위한 일간 계획을 체계적으로 수행할 수 있을 것입니다. 하지만, 계획은 개인의 상황에 맞게 유연하게 조정할 필요가 있으니 참고 바랍니다.',
        '3주','주','PERIOD','토일요일마다','DATE',
        NULL,'풍경화 완성하기','ACTIVE',NULL,NULL);
 */

